-- ----------------------------
-- Table structure for ad_encourage
-- ----------------------------
DROP TABLE IF EXISTS `ad_encourage`;
CREATE TABLE `ad_encourage`  (
  `adv_encourage_id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '激励广告id',
  `adv_type_id` char(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '5' COMMENT '广告类型',
  `app_id` bigint(20) NULL DEFAULT NULL COMMENT '应用id',
  `player_id` bigint(20) NULL DEFAULT NULL COMMENT '用户id',
  `wx_nick_name` varchar(125) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '微信昵称',
  `request_id` varchar(70) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '广告请求id',
  `trans_id` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '穿山甲的唯一交易id',
  `code_bit_id` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '该广告属于哪个代码位',
  `server_callback_time` datetime NULL DEFAULT NULL COMMENT '被服务端回调时间',
  `is_server_call` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '1' COMMENT '是否服务端回调 0是有 1是无',
  `is_client_call` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '1' COMMENT '是否客户端回调 0是有 1是无',
  `client_callback_time` datetime NULL DEFAULT NULL COMMENT '被客户端回调时间',
  `request_time` datetime NULL DEFAULT NULL COMMENT '请求时间 （广告被用户点开查看的时间）',
  `encourage_from` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '该激励广告的来源',
  `encourage_reward` double(20, 5) NULL DEFAULT 0.00000 COMMENT '广告奖励',
  `encourage_ecpm` double(20, 6) NULL DEFAULT 0.000000 COMMENT '看此激励广告可获得的ecpm',
  `first_click_time` datetime NULL DEFAULT NULL COMMENT '看广告的第一次点击时间',
  `click_times` int(11) NULL DEFAULT 0 COMMENT '该次广告点击量（用户的行为，他看这一次广告，点击了多少下（客户端传给我的））',
  `ask_adv_put_time` int(11) NULL DEFAULT 0 COMMENT '看广告点击按钮按压时长 (开红包)',
  `get_reward_click_time_date` int(11) NULL DEFAULT 0 COMMENT '收下奖励点击按钮按压时长',
  `ip` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '看此次广告的ip',
  `is_close_encourage_adv` char(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '是否关闭广告 0是关 ,1是没关',
  `is_see_end` char(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '是否完整观看视频  0是完整  1是不完整',
  `is_display_ad` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '是否展示广告  0是展示  1是不展示',
  `is_old_player` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '是否新老用户  0是新 1是老',
  `exception_operate` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '异常操作信息',
  `err_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '错误信息',
  `address` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '位置信息',
  PRIMARY KEY (`adv_encourage_id`) USING BTREE,
  UNIQUE INDEX `request_id`(`request_id` ASC, `trans_id` ASC) USING BTREE,
  INDEX `player_id`(`adv_type_id` ASC, `player_id` ASC) USING BTREE COMMENT '组合索引',
  INDEX `request_time`(`adv_type_id` ASC, `request_time` ASC) USING BTREE,
  INDEX `adv_type_id`(`adv_type_id` ASC, `wx_nick_name` ASC) USING BTREE,
  INDEX `adv_type_id_2`(`adv_type_id` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5000000000164 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

