  `totalRed` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '从注册到这次的红包总值',
  `today_encourageAdv_count` int(6) NULL DEFAULT 0 COMMENT '当日观看激励广告数量',
  `server_CallBack_no` int(6) NULL DEFAULT 0 COMMENT '当日无服务端回调广告数量  (三种类型的都记)',
