  `service_CallBack_Reward_Count` int(6) NULL DEFAULT 0 COMMENT '当日服务端回调且有奖励数量',
  `service_CallBack_default_none_ward_Count` int(11) NULL DEFAULT NULL COMMENT '当日服务端回调且默认无奖励数量       ',
  `retain_time` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录本次留存登录时间',
  `day_cash` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '当日提现金额(触发了审核的+免审核的)',
  `day_withdraw` decimal(10, 2) NULL DEFAULT NULL COMMENT '当日提现打款金额',
  `day_withdraw_judge` decimal(11, 0) NULL DEFAULT 0 COMMENT '当日提现审核金额',
  `day_rebate` decimal(11, 0) NULL DEFAULT 0 COMMENT '当日返现打款金额',
  `day_rebate_judge` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '当日返现审核的金额',
  `day_charge_rebate` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '当日充值返现金额',
  `is_retain` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '1' COMMENT '该日是否留存(默认所有用户每日都有留存数据,该日没上线的用户就为1,上线过的就是0)',
  PRIMARY KEY (`day_id`) USING BTREE,
  INDEX `player_id`(`player_id` ASC, `retain_time` ASC, `day_id` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 341 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

