  `real_name` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '人名',
  `wx_headimgurl` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '微信头像',
  `player_creat_time` datetime NULL DEFAULT NULL COMMENT '创建时间 （也就是第一次登入游戏的时间，判断新老用户的）',
  `proxy_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0' COMMENT ' 默认0是属于我们的用户，有代理团队，就是代理团队的id',
  `status` char(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '1' COMMENT '用户状态 （是否被封禁 1是正常用户，0是被封禁用户）',
  `mobile_id` bigint(10) NULL DEFAULT NULL COMMENT '设备型号ID',
  `in_red` decimal(20, 2) NULL DEFAULT 0.00 COMMENT '红包余额',
  `special` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '1' COMMENT '是否特殊用户 0特殊用户',
  PRIMARY KEY (`player_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1000038 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

