-- Event structure for batch_add_player_dayrecord
-- ----------------------------
DROP EVENT IF EXISTS `batch_add_player_dayrecord`;
delimiter ;;
CREATE EVENT `batch_add_player_dayrecord`
ON SCHEDULE
EVERY '1' DAY STARTS '2024-01-06 03:00:00'
ON COMPLETION PRESERVE
DO INSERT INTO day_behave_recordlist(player_id)
(SELECT player_id FROM player)
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
